input=""""""

foundLetters = []
count = 0

#P1
for x in range(0,len(input)):
    if len(foundLetters) == 4:
        print(foundLetters, count+1)
        break
    foundLetters = []
    for n in range(0, 4):
        if input[x+n] not in foundLetters:
            foundLetters.append(input[x+n])
            count = x + n
        else:
            foundLetters = []
            break

